CREATE DEFINER=`root`@`localhost` PROCEDURE `add_tmp_date`(IN `length` int)
BEGIN
    SET @last = (SELECT setting_date FROM ylshop.yl_tmp_date ORDER BY setting_date DESC LIMIT 0,1);
    SET @days = 1;
    WHILE @days<=length DO
        SET @add_date = DATE_ADD(@last,INTERVAL @days DAY);
        INSERT INTO ylshop.yl_tmp_date(setting_date) VALUES(@add_date);
        SET @days = @days +1; 
    END WHILE;
END ;;
