CREATE DEFINER=`root`@`localhost` PROCEDURE `bi_count_init`(IN `var_startDate` date,IN `var_endDate` date)
BEGIN
		WHILE DATEDIFF(var_endDate, var_startDate) >= 0 DO
			SELECT var_endDate;
			# 根据平台每天访问pv、uv,ipv
			CALL day_count_visit(var_endDate);
      # 根据页面每天访问pv、uv
      CALL day_count_visit_by_page(var_endDate);
		
			SET var_endDate = DATE_ADD(var_endDate, INTERVAL -1 DAY);
		END WHILE;
END ;;
