CREATE DEFINER=`root`@`localhost` PROCEDURE `day_count_visit`(IN `var_date` date)
BEGIN
		# Create day_count_vist data...
		# Clear data
		DELETE FROM ylshop.yl_day_count_visit WHERE `date` = var_date;

		INSERT INTO ylshop.yl_day_count_visit(type,date,pv,uv,ipv)
    SELECT A.type, A.date_added, sum(A.pv) pv, count(*) uv, 
			    (SELECT count(*) 
				   FROM ylshop.yl_urllog yu1 
				   WHERE goods_id!=0 AND date(yu1.date_added) = var_date) ipv 
		 FROM (
				  SELECT type,date(yu.date_added) date_added, usersign,goods_id ,count(*) pv
					FROM ylshop.yl_urllog yu 
					WHERE date(yu.date_added) = var_date
					GROUP BY type,usersign
	  ) A 
    GROUP BY A.type;

END ;;
DELIMITER ;
