CREATE DEFINER=`root`@`localhost` PROCEDURE `day_count_visit_by_page`(IN `var_date` date)
BEGIN
		# Create day_count_vist_by_page data...
		# Clear data
		DELETE FROM ylshop.yl_day_count_visit_by_page WHERE `date` = var_date;

		INSERT INTO ylshop.yl_day_count_visit_by_page(type,sourcecode,`from`,date,page_url,pagetitle,pv,uv)
    SELECT A.type, A.sourcecode,A.`from`,A.date_added,A.url,A.pagetitle, sum(A.pv) pv, count(*) uv
			    
		 FROM (
				  SELECT type,sourcecode,`from`,date(yu.date_added) date_added,url,pagetitle,count(*) pv
					FROM ylshop.yl_urllog yu 
					WHERE date(yu.date_added) = var_date
					GROUP BY url,usersign
	  ) A 
    GROUP BY A.url;

